import React, { PureComponent } from "react";
import "./App.css";
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
} from "recharts";

export default class RuntimeLineChart extends PureComponent {
  static jsfiddleUrl = "https://jsfiddle.net/alidingling/xqjtetw0/";

  render() {
    const { title, data, stroke1, stroke2, stroke3 } = this.props;
    return (
      <div>
        <h3 className="barTitle">{title}</h3>

        <LineChart
          width={500}
          height={300}
          data={data}
          margin={{
            top: 5,
            right: 30,
            left: 20,
            bottom: 5,
          }}
        >
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis
            label={{ value: "Iteration", position: "right" }}
            dataKey="name"
          />
          <YAxis label={{ value: "Runtime (ms)", position: "left" }} />
          <Tooltip />
          <Legend />
          <Line
            type="monotone"
            dataKey="ble"
            dot={false}
            stroke={stroke1}
            strokeWidth={[{ x: 50, y: 50, value: 300 }]}
            // activeDot={{ r: 8 }}
          />
          <Line
            type="monotone"
            dataKey="scan"
            dot={false}
            stroke={stroke2}
            // stroke="#82ca9d"
          />
          <Line
            type="monotone"
            dataKey="total"
            dot={false}
            stroke={stroke3}
            // stroke="#82ca9d"
          />
        </LineChart>
      </div>
    );
  }
}
